   const style={
      default: "inline-flex items-center justify-center rounded-md bg-gray-50 p-2 text-gray-400 hover:bg-gray-100 hover:text-gray-500 focus:outline-none focus:ring-2 focus:ring-inset focus:ring-indigo-500",
      add: "",
      delete: ""
   }
  return (
    <div>
      <button className={style[buttonType]} { ...props }>{children}</button>
    </div>
  );
};

export default Button;
